import { useRouter } from "next/router";
import { List as Products } from "../components/Product/list";

import { toAttributeGourpWhereInput } from "../lib/chip";

import { Container, Row, Col } from "reactstrap";
import { Sidebar } from "../components/Sidebar";
import { theme } from "../config/index";

import { Filter } from "../components/Product/filter";

import { css } from "../components/src/css";
import { HeaderStory } from "../components/UI/HeaderStory";
import { Fragment } from "react";
import { Feature } from "../components/UI/Feature";
import { BgDivider } from "../components/UI/bgDiviver";
const Index = () => {
  return (
    <Fragment>
      <HeaderStory />
      <Feature />
      <Container>
        <h2
          style={{
            ...css.h2,
            textAlign: "center",
            marginBottom: theme.spacing(5),
          }}
        >
          Sản Phẩm Khuyến Mãi
        </h2>
        <Products first={4} lg={4} xl={4} sale more={false} />
      </Container>
      <BgDivider />
      <Container>
        <h2
          style={{
            ...css.h2,
            textAlign: "center",
            marginBottom: theme.spacing(5),
          }}
        >
          Sản Phẩm Bán Chạy
        </h2>
        <Products
          first={4}
          lg={3}
          xl={3}
          suggestions="bestSeller"
          more={false}
        />
      </Container>
    </Fragment>
  );
};
export default Index;
